import React from 'react';
import { MDBBtn, MDBContainer } from 'mdb-react-ui-kit';
import Header from './Components/Header/Header';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './Components/Home/Home';

function App() {
  return (
    <div>
      <Header></Header>
      <Router>
        <Switch>
          <Router path="/home">
             <Home></Home>
          </Router>
          <Router path="/home">
             <Home></Home>
          </Router>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
